  import React, { Component } from "react";
  import {Row,Col} from 'react-bootstrap';

  class Inscription extends React.Component {

    constructor(props)
    {

      super(props);

      this.state = {

       id_users : "",
       first_name_users : "",
       last_name_users : "",
       email_users : "",
       password_users : "",
       is_admin_users : false
     }

    }


  render() {


    return (
      <div>
      <h2> Inscription </h2>

      <Form>

    <Row>

    <Col xs={6}>
    <Form.Group as={Row} className="label_form">
    <Form.Label className="info_form" column sm={3}>
    Adress
    </Form.Label>
    <Col sm={9}>
    <Form.Control
    type="text"  
    value={this.state.adress}
    onChange={this.handleTableInput}
    name="adress"
    />
    </Col>
    </Form.Group>
    </Col>
      
    </Row>



      </Form>

      </div>)

}

}

export default Inscription;
